(6005, 34, 4, 'Perforated Sheath Dress', '118.00', 'perforated_sheath_dress.png', 'Lane Collection Perforated Sheath Dress', 'A sassy twist on your Little Black Dress, this stunning sheath amps up the attitude with a perforated top panel to lets a little contrast peek through. From our designer-inspired Lane Collection, this gorgeous number was created with curves in mind from the slimming contoured seaming to the unique colorblocking that draws the eye inward. Soft ponte knit construction lends a bit of stretch for a figure-hugging fit, plus it resists wrinkles, fading and pilling. An exposed back zipper and subtle high-low hem completes the look.', '2014-02-26 00:00:00', 2, 'http://www.lanebryant.com/catalog/product.jsp?productId=200286', 'Buy', '', 0, 1, 0),
(6006, 34, 4, 'Textured Panel Sheath Dress', '89.95', 'panel_sheath_dress.png', 'Textured Panel Sheath Dress', 'A textured center panel amps up the attitude on the classic Little Black Dress, making this figure-loving sheath one to love from season to season. Soft knit sheath accentuates all your positives with a square neckline and flattering, banded waist. Short sleeves. Hidden side zipper.', '2014-02-26 00:00:00', 2, 'http://www.lanebryant.com/catalog/product.jsp?productId=199627', 'Buy', '', 0, 1, 0),
(6007, 34, 4, 'Paneled Sheath Dress', '89.95', 'paneled_sheath_dress.png', 'Paneled Sheath Dress', 'Professional for the office with enough panache to carry you through evening and weekend occasions, our paneled sheath dress makes an art of curve flattery. Contoured to hug your shape in all the right places, this beautiful number features wide tank straps, a scoop neckline and a banded waist. Hidden side zipper with hook & eye closure. Fully lined.', '2014-02-26 00:00:00', 2, 'http://www.lanebryant.com/catalog/product.jsp?productId=202420', 'Buy', '', 0, 1, 0),
(6008, 34, 4, 'Pieced Sheath Dress', '89.95', 'pieced_sheath_dress.png', 'Pieced Sheath Dress', 'Reimagining the classic pairing of black and white, our curve-flaunting sheath dress features pieced paneling to highlight all your assets. This confidence-boosting silhouette was made to flatter with tapered colorblocking and a banded waist, plus wide tank straps and a square neckline. Hidden side zipper with hook & eye closure. Fully lined.', '2014-02-26 00:00:00', 2, 'http://www.lanebryant.com/catalog/product.jsp?productId=202421', 'Buy', '', 0, 1, 0),
(6009, 34, 4, 'Belted Sheath Dress', '89.95', 'belted_sheath_dress.png', 'Colorblock Sheath Dress With Belt', 'Our curve-hugging sheath dress amps up your wow factor with a contoured fit and bold colorblocking. A terrific pick for work or weekend, this number was made for hourglass curves with wide tank straps, scoop neckline and banded waist. A patent skinny belt finishes the look with a pop of shine. Back zipper with hook & eye closure.', '2014-02-26 00:00:00', 2, 'http://www.lanebryant.com/catalog/product.jsp?productId=204001', 'Buy', '', 0, 1, 0),
(6010, 34, 4, 'Printed Tulip Dress', '79.95', 'printed_tulip_dress.png', 'Printed Tulip Dress', 'A flirty tulip hem and energetic floral print add eye-exciting dimension to this flattering faux wrap dress. Charmingly detailed with cap sleeves and a scoop neckline, this silky woven dress offers a lovely silhouette on any shape with an elastic seamed waist with pleats at one hip. Fully lined. Hidden side zipper with hook & eye closure.', '2014-02-26 00:00:00', 2, 'http://www.lanebryant.com/catalog/product.jsp?productId=202403', 'Buy', '', 0, 1, 0),
