(6120, 42, 4, 'Green Distressed Flameless', '1.49', 'michaels_candle_2.png', 'Green Distressed Flameless', 'Enjoy the beauty of a votive candle without the flame! Flickering LED bulb will not get hot and will last over 100,000 hours. Votive comes with 1 x CR2032 battery for 60+ hours of use and includes an on/off switch on the bottom.', '2014-03-19 00:00:00', 2, 'http://www.michaels.com/Green-Distressed-Flameless-LED-Votive/hd0587,default,pd.html?cgid=products-homedecor-candleandfragrance', 'Buy', '', 0, 1, 0),
(6121, 42, 4, 'Olive Flameless Warmer', '1.49', 'michaels_candle_3.png', 'Olive Flameless Warmer', 'This attractive wax warmer, exclusive to Michaels, enhances the atmosphere of your home by quickly and safely releasing fragrance in large rooms. The easy-to-use warming bulb heats the ceramic melting dish to distribute the fragrance of wax cubes and fragrance oils. Reduce the risk of fire and smoke damage associated with open flame. Create your signature scent by combining your favorite scents in the same dish. Features a convenient on/off switch.', '2014-03-19 00:00:00', 2, 'http://www.michaels.com/Olive-Flameless-Warmer/hd0523,default,pd.html?cgid=products-homedecor-candleandfragrance', 'Buy', '', 0, 1, 0),
(6122, 42, 4, 'Ivory Smooth Flameless', '1.49', 'michaels_candle_4.png', 'Ivory Smooth Flameless LED Candle, 4"x8"', 'Add the beauty and fragrance of a flickering candle to your home without the flame! Made with real wax and a realistic melted edge, this candle has the look and feel of a real wicked candle. Three flickering LEDs create a natural and realistic glow. Candle also includes a 4-hour timer', '2014-03-19 00:00:00', 2, 'http://www.michaels.com/Ivory-Smooth-Flameless-LED-Candle-4x8/hd0577,default,pd.html?cgid=products-homedecor-candleandfragrance', 'Buy', '', 0, 1, 0),
