(6135, 10333, 4, 'LUXE LINK CUFF', '20.00', 'cc_luxe_link_cuff.png', 'LUXE LINK CUFF', 'Create fabulously stacked looks with the right wrist accents. This cuff bracelet features ultra sparkling details on polished metal links similar to a classic men''s watch band. A must-have for every arm candy maven!', '2014-03-26 00:00:00', 2, 'http://www.charmingcharlie.com/whats-new/arm-candy/luxe-link-cuff.html', 'Buy', '', 0, 1, 0),
