(6137, 10333, 4, 'METAL HEAVEN BANGLE SET', '18.00', 'cc_metal_heaven_bangle.png', 'METAL HEAVEN BANGLE SET', 'Metal mixing reaches heavenly heights with this glittery glam bangle set. Three thin band bracelets in a trio of wardrobe-friendly tones with all-around rhinestones. Layer for extra luxe.', '2014-03-26 00:00:00', 2, 'http://www.charmingcharlie.com/whats-new/arm-candy/metal-heaven-bangle-set.html', 'Buy', '', 0, 1, 0),
(6138, 10333, 4, 'HEX GEMS CUFF BRACELET', '10.00', 'cc_hex_gems_cuff.png', 'HEX GEMS CUFF BRACELET', 'Shape up your style with sparkly arm candy. The embellished, tonal ends of this cuff bracelet feature hexagon gems with rhinestone trim. It''s a perfect, polished way to pull any look together.', '2014-03-26 00:00:00', 2, 'http://www.charmingcharlie.com/whats-new/arm-candy/hex-gems-cuff-bracelet.html', 'Buy', '', 0, 1, 0);
